import React from 'react';
import { Link } from 'react-router-dom';
import '../css/Sidebar.css';
//import AvatarImage from '../images/avatar.jpg'; // Update with the actual path to your avatar image

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-top">
       
        <div className="user-name">John Doe</div>
        <div className="user-email">john.doe@example.com</div>
        <button className="update-profile-button">Update Profile</button>
      </div>
      <ul>
        <li><Link to="/employer/home">Home</Link></li>
        <li><Link to="/employer/users">Users</Link></li>
        <li><Link to="/employer/find-jobs">Find Jobs</Link></li>
        <li><Link to="/employer/jobs-applied">Jobs Applied</Link></li>
        <li><Link to="/employer/save-jobs">Save Jobs</Link></li>
        <li><Link to="/employer/alerts">Alerts</Link></li>
        <li><Link to="/employer/my-resume">My Resume</Link></li>
        {/* Add more links as needed */}
      </ul>
    </div>
  );
};

export default Sidebar;
